import {
  AlertDialog,
  AlertDialogClose,
  AlertDialogContent,
  AlertDialogDescription,
  AlertDialogFooter,
  AlertDialogTitle,
  AlertDialogTrigger,
} from "@/registry/default/ui/alert-dialog";

import { Button } from "../ui/button";

export default function AlertDialogDemo() {
  return (
    <AlertDialog>
      <AlertDialogTrigger render={<Button>Open</Button>} />
      <AlertDialog>
        <AlertDialogContent>
          <AlertDialogTitle>wawe</AlertDialogTitle>
          <AlertDialogDescription>asdas</AlertDialogDescription>
        </AlertDialogContent>
        <AlertDialogFooter>
          <AlertDialogClose render={<Button>Close</Button>} />
        </AlertDialogFooter>
      </AlertDialog>
    </AlertDialog>
  );
}
